Squares of side length 1 are arranged to form the figure shown. What is the perimeter of the figure? [asy]

size(6cm);

path sqtop = (0, 0)--(0, 1)--(1, 1)--(1, 0);

path sqright = (0, 1)--(1, 1)--(1, 0)--(0, 0);

